import React, {useEffect,useRef} from 'react';
import Rellax from "rellax";
import './cv.css'
import CvFront from './img/CvFront.jpg'
import back from './img/back.jpg'


const CV = () => {

  const rellaxRef = useRef();

  useEffect(() => {
    new Rellax(rellaxRef.current, {
      speed: 4,
      center: false,
      wrapper: null,
      round: true,
      vertical: true,
      horizontal: false
    });


  }, []);
  console.log(rellaxRef)
  return (
    <div className="one">
      <img src={CvFront} alt="img" />

      <div className="map ">
        <img src={back} alt="img" useRef={rellaxRef} />
      </div>


    </div>
  );
};

export default CV;
